import React from 'react';
import { Link } from 'react-router-dom';
const Skills = () => {
  return (
    <div className='container py-5'>
      <div className='row'>
        <div className='col-md-3'>
          <nav className='nav-link' id='navi'>
            <ul className>
              <li>
                <Link to='#page-1'>Education</Link>
              </li>
              <li>
                <Link to='#page-2'>Experience</Link>
              </li>
              <li>
                <Link to='#page-3'>Skills</Link>
              </li>
            </ul>
          </nav>
        </div>
      </div>
    </div>
  );
};

export default Skills;
